description:
Music video to the second single by Sumire Uesaka. The song is also used as the
opening theme of TV anime series, Genshiken Nidaime.


Artist: Sumire Uesaka
Music Video: Genshi, Jyoshi wa, Taiyou datta.
Genre: Pop/Rock
Release date: July 10, 2013


